$(document).ready(function(){

    $('#ucp .panel, #ucp .submit-buttons').hide();

    var virgil = '<div class="panel stop-virgil">' +
                    '<div class="inner">' +
                        '<fieldset>' +
                            '<table width="100%">' +
                                '<tr>' +
                                    '<td style="vertical-align: middle; height: 100px;">' +
                                        '<div style="float: left; line-height: 50px;">You are using Virgil Pass to login to this website. Click <a href="javascript:void(0);" class="show-password">here</a> or on the Virgil logo to switch back to using passwords.</div>' +
                                        '<div style="float: right;"><img width="50" height="50" class="show-password" style="cursor: pointer;" src="data:image/png;base64,"/></div>' +
                                    '</td>' +
                                '</tr>' +
                            '</table>' +
                        '</fieldset>' +
                    '</div>' +
                 '</div>';

    $('.submit-buttons').before(virgil);

    $('.show-password').click(function(){
        $('.stop-virgil').remove();
        $('#ucp .panel, #ucp .submit-buttons').show();
    })
})